var hasOwnProperty = Object.prototype.hasOwnProperty;
export var Platform = {
    OS: 'unknown',
    Version: 0,
    select: function (obj) {
        if (hasOwnProperty.call(obj, Platform.OS)) {
            return obj[Platform.OS];
        }
        return obj["default"];
    },
    inject: function (platform) {
        Platform.OS = platform.OS;
        Platform.Version = platform.Version;
    }
};
